description:
Here is the complete english-translated version of Survival Girl, by Kudo Hiroshi.

The manga is made of short stories (one per chapter, 7 chapters), about &quot;unusual&quot; girls (not the usual student or housewife, either completely nuts like in chapter 7, or homeless like in two chapters, for instance) having great sex.
There isn't forced sex at all in this manga, just girls happy to fuck.
Most of the girls have huge tits (man, these titfucks !!), the drawings are rather strange when you look at how the eyes are drawn, there is close to zero censorship.

End of the description, just leech the torrent ;)

